import React from "react";
import "./Tarjeta.css";

function Tarjeta({ palabraEsp, palabraSue, tipo }) {
  return (
    <div className="tarjeta">
      <h3>{palabraEsp}</h3>
      <p>{palabraSue}</p>
      {tipo && <p className="tipo">{tipo === "en" ? "En (sustantivo)" : "Ett (sustantivo)"}</p>}
    </div>
  );
}

export default Tarjeta;
